        display: 'inline-block',
        marginRight: '15px',
    },
    navLink: {
        color: 'white',
        textDecoration: 'none',
        fontWeight: 'bold',
    },
    formContainer: {
        backgroundColor: 'white',
        width: '80%',
        maxWidth: '600px',
        margin: '30px auto',
        padding: '20px',
        borderRadius: '10px',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
    },
    sectionTitle: {
        color: '#6a1b9a',
        marginBottom: '20px',
    },
    label: {
        display: 'block',
        marginBottom: '5px',
        fontWeight: 'bold',
    },
    input: {
        padding: '10px',
        marginBottom: '15px',
        border: '1px solid #ddd',
        borderRadius: '5px',
        width: '100%',
    },
    textarea: {
        padding: '10px',
        marginBottom: '15px',
        border: '1px solid #ddd',
        borderRadius: '5px',
        width: '100%',
        height: '100px',
    },
    select: {
        padding: '10px',
        marginBottom: '15px',
        border: '1px solid #ddd',
        borderRadius: '5px',
        width: '100%',
    },
    fileInput: {
        marginBottom: '15px',
        padding: '10px',
        border: '1px solid #ddd',
        borderRadius: '5px',
        width: '100%',
    },
    button: {
        padding: '10px 20px',
        backgroundColor: '#6a1b9a',
        color: 'white',
        border: 'none',
        borderRadius: '5px',
        fontSize: '16px',
        cursor: 'pointer',
        transition: 'background-color 0.3s',
    },
    buttonHover: {
        backgroundColor: '#5a1590',
    },
    footer: {
        marginTop: 'auto',
        backgroundColor: '#333',
        color: 'white',
        textAlign: 'center',
        padding: '10px',
    },
};

export default EditAssignment;
